// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.12;

contract Milk {
    //  
    struct Buyer {
        address buyerAddress;
        bytes32 user_name;
        bytes32 user_nickname;
        bytes32 user_email;
        bytes32 user_address;
        bytes32 user_milk;
    }

    //  
    struct Seller {
        address sellerAddress;
        bytes32 user_name;
        bytes32 user_nickname;
        bytes32 user_email;
        bytes32 user_address;
    }

    //  
    struct Payment {
        address buyerAddress;
        uint date;
    }

    //  
    struct Cancel {
        address buyerAddress;
        uint date;
    }

    //  
    struct doPay {
        address managerAddress;
        uint date;
    }

    struct doCancel {
        address managerAddress;
        uint date;
    }

    mapping (uint => Buyer) public buyerInfo;
    mapping (uint => Seller) public sellerInfo;
    mapping (uint => Payment) public decidePaymentInfo;
    mapping (uint => Cancel) public decideCancelInfo;
    mapping (uint => doPay) public doPaymentInfo;
    mapping (uint => doCancel) public doCancelInfo;

    address public owner; //   
    address[10] public buyers; //  
    address[10] public sellers; //  
    address[10] public decidePayments; //  
    address[10] public decideCancels; //   
    address[10] public doPayments; //  
    address[10] public doCancels; //  

    

}
